import DateTime from "./components/greetings.js";
import DisplayTime from "./components/timeInScreen";

const App = () => {
    return(
        //JSX Code syntax 
    <section className="main">
        <div className="date">
            <DateTime></DateTime>
        </div>
        <div className="name">
            <DisplayTime ></DisplayTime>
        </div>
            <hr></hr>
            <p>Expense Report</p>
        <div>
            <hr></hr>
            <ExpenseItem></ExpenseItem>
            <ExpenseItem></ExpenseItem>
            <ExpenseItem></ExpenseItem>
            <ExpenseItem></ExpenseItem>
            <ExpenseItem></ExpenseItem>
            <ExpenseItem></ExpenseItem>
            <ExpenseItem></ExpenseItem>

        </div>
    </section>

    );

}

export default App;
